package Session1;

public class Relational_Operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 10;
		int b = 20;
		
		System.out.println(a==b);  // false
		System.out.println(a!=b);  //True
		System.out.println(a>b);   //False
		System.out.println(a<b);   //True
		System.out.println(a>=b);  // True
		System.out.println(a<=b);  //False
		
	}

}
